import React from 'react';

const SellPage = () => (
    <div className="generic-page">
        <h1>Sell on Shopify</h1>
        <p>Join millions of sellers on our platform and reach a massive audience. We provide the tools and support you need to grow your business.</p>
        <h2>Why Sell with Us?</h2>
        <p>Benefit from our large customer base, secure payment processing, and easy-to-use seller tools.</p>
    </div>
);

export default SellPage;
